
-- Create a sample crm database in the public schmea of postgres database

DROP TABLE IF EXISTS public.accounts, public.contacts, public.opportunities, public.tasks, public.customers CASCADE;

CREATE TABLE public.accounts (
    account_id TEXT PRIMARY KEY,
    account_name TEXT,
    industry TEXT,
    billing_city TEXT,
    billing_state TEXT,
    billing_country TEXT
);

CREATE TABLE public.contacts (
    contact_id TEXT PRIMARY KEY,
    account_id TEXT REFERENCES public.accounts(account_id),
    first_name TEXT,
    last_name TEXT,
    email TEXT,
    phone TEXT
);

CREATE TABLE public.opportunities (
    opportunity_id TEXT PRIMARY KEY,
    account_id TEXT REFERENCES public.accounts(account_id),
    name TEXT,
    amount NUMERIC(10,2),
    stage TEXT,
    close_date DATE
);

CREATE TABLE public.tasks (
    task_id TEXT PRIMARY KEY,
    subject TEXT,
    status TEXT,
    priority TEXT,
    due_date DATE,
    related_to TEXT
);

CREATE TABLE public.customers (
    customer_id TEXT PRIMARY KEY,
    account_id TEXT REFERENCES public.accounts(account_id),
    name TEXT,
    email TEXT,
    hvac_system_type TEXT
);

